import React from "react";

function Filter() {
    return (
        <form className="filter">
            <h3>Sort by:</h3>
            <select>
                <option>Bla</option>
                <option>Bla2</option>
            </select>
            <h3>Filter by:</h3>
            {/* <input type="checkbox">Great</input>
            <input type="checkbox">Great2</input> */}
        </form>
    )
}

export default Filter;
